import {
Box,
Container,
Heading,
} from "./FooterStyles";
import "./Icons.css";

const Footer = () => {
return (
	<Box>
	<Container>
			<Heading>Social Media</Heading>
			<a href="#" className="fa fa-facebook">
			</a>
			<a href="#" className="fa fa-twitter">
			</a>
			<a href="#" className="fa fa-instagram">
			</a>
	</Container>
	</Box>
);
};
export default Footer;
